import "./App.css";
import { useState } from "react";
import Axios from "axios";

function App() {
  const [user_id, setUser_id] = useState();
  const [user_handle, setUser_Handler] = useState("");
  const [first_name, setFirst_Name] = useState("");
  const [last_name, setLast_Name] = useState("");
  const [phonenumber, setPhonenumber] = useState();
  const [usersList, setUsers] = useState([]);
  const [editar, setEditar] = useState(false);

  const addUser = () => {
    Axios.post("http://localhost:3001/create", {
      user_handle: user_handle,
      first_name: first_name,
      last_name: last_name,
      phonenumber: phonenumber,
    }).then(() => {
      alert("empleado registrado");
    });
  }

  const getUsers = () => {
    Axios.get("http://localhost:3001/users").then((response) => {
      setUsers(response.data);
    });
  }
  const updateUser = () => {
    Axios.put("http://localhost:3001/update", {
      user_id: user_id,
      user_handle: user_handle,
      first_name: first_name,
      last_name: last_name,
      phonenumber: phonenumber,
    }).then(() => {
      alert("empleado registrado");
    });
  }

  const uploadUser = (val) => {
    setEditar(true);

    setUser_id(val.User_id);
    setUser_Handler(val.user_handle);
    setFirst_Name(val.first_name);
    setLast_Name(val.last_name);
    setPhonenumber(val.phonenumber);
  }


  return (
    <div className="App">
      <div className="Datos">
        <label>
          user_handle{" "}
          <input
            onChange={(event) => {
              setUser_Handler(event.target.value);
            }}
            type="text"
            value={user_handle || ''}
            placeholder="Ingrese su nombre de usuario"
          ></input>
        </label>
        <label>
          first_name{" "}
          <input
            onChange={(event) => {
              setFirst_Name(event.target.value);
            }}
            type="text"
            value={first_name || ''}
            placeholder="Ingrese su primer nombre"
          ></input>
        </label>
        <label>
          last_name{" "}
          <input
            onChange={(event) => {
              setLast_Name(event.target.value);
            }}
            type="text"
            value={last_name || ''}
            placeholder="Ingrese su primer apellido"
          ></input>
        </label>
        <label>
          phonenumber{" "}
          <input
            onChange={(event) => {
              setPhonenumber(event.target.value);
            }}
            type="number"
            value={phonenumber || ''}
            placeholder="Ingrese su numero de telefono"
          ></input>
        </label>
        {
          editar == true?  
          <div>
          <button onClick={updateUser}>Actualizar</button> 
          <button onClick={addUser}>Cancelar</button> 
          </div>
          : <button onClick={addUser}>Registrar</button>
        }

        <button onClick={getUsers}>Mostrar Usuarios</button>
      </div>
      <div>
        <table className="List">
          <thead className="ListHead">
            <tr>
              <th>#</th>
              <th>Nick Name</th>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Telefono</th>
            </tr>
          </thead>
          <tbody className="ListBody">
            {
              usersList.map((val,key) =>{
                return (
                  <tr key={val.user_id}>
                    <th>{val.user_id}</th>
                    <th>{val.user_handle}</th>
                    <th>{val.first_name}</th>
                    <th>{val.last_name}</th>
                    <th>{val.phonenumber}</th>
                    <th>
                      <button
                        onClick={()=>{
                         uploadUser(val);
                        }}
                      >Modificar</button></th>
                    <th>
                      <button
                        onClick={()=>{

                         }}
                      >Eliminar</button></th>
                  </tr>
                )
              })
            }
          </tbody>
        </table>



      </div>
    </div>
  );
}

export default App;
